import Slider from "react-slick";
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import React, { Component } from "react";
import { projectsInfo } from "../const/const";

const ProjectstSlider = () => {
  console.log(` {projectsInfo.images`,  projectsInfo.images)
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1
    };
    return (
      <div>
        <h2> Single Item</h2>
        <Slider {...settings}>
        {projectsInfo.images.map((slide) => {
                return <div key={slide} className={`intro__slide slide-intro slide-intro--${slide.className}`}>
                    <img src={slide} alt="" width="555" height="400"></img>
                </div>
            })}
        </Slider>
      </div>
    );
}

export default ProjectstSlider;
